Let's write some tests first that we can execute while we iterate on our lint. Clippy uses UI tests for testing. UI tests check that the output of Clippy is exactly as expected. Each test is just a plain Rust file that contains the code we want to check. The output of Clippy is compared against a .stderr file. Note that you don't have to create this file yourself, we'll get to generating the .stderr files further down. We start by opening the test file created at tests/ui/foo_functions.rs. Update the file with some examples to get started: #![warn(clippy::foo_functions)] // Impl methods
struct A;
impl A { pub fn fo(&self) {} pub fn foo(&self) {} pub fn food(&self) {}
} // Default trait methods
trait B { fn fo(&self) {} fn foo(&self) {} fn food(&self) {}
} // Plain functions
fn fo() {}
fn foo() {}
fn food() {} fn main() { // We also don't want to lint method calls foo(); let a = A; a.foo();
} Now we can run the test with TESTNAME=foo_functions cargo uitest, currently this test is meaningless though. While we are working on implementing our lint, we can keep running the UI test. That allows us to check if the output is turning into what we want. Once we are satisfied with the output, we need to run cargo dev bless to update the .stderr file for our lint. Please note that, we should run TESTNAME=foo_functions cargo uitest every time before running cargo dev bless. Running TESTNAME=foo_functions cargo uitest should pass then. When we commit our lint, we need to commit the generated .stderr files, too. In general, you should only commit files changed by cargo dev bless for the specific lint you are creating/editing. Note that if the generated files are empty, they should be removed. Note that you can run multiple test files by specifying a comma separated list: TESTNAME=foo_functions,test2,test3.

