Let's start by opening the new file created in the clippy_lints crate at clippy_lints/src/foo_functions.rs. That's the crate where all the lint code is. This file has already imported some initial things we will need: use rustc_lint::{EarlyLintPass, EarlyContext};
use rustc_session::{declare_lint_pass, declare_tool_lint};
use rustc_ast::ast::*; The next step is to update the lint declaration. Lints are declared using the declare_clippy_lint! macro, and we just need to update the auto-generated lint declaration to have a real description, something like this: declare_clippy_lint! { /// **What it does:** /// /// **Why is this bad?** /// /// **Known problems:** None. /// /// **Example:** /// /// ```rust /// // example code /// ``` pub FOO_FUNCTIONS, pedantic, "function named `foo`, which is not a descriptive name"
} The section of lines prefixed with /// constitutes the lint documentation section. This is the default documentation style and will be displayed like this . To render and open this documentation locally in a browser, run cargo dev serve. FOO_FUNCTIONS is the name of our lint. Be sure to follow the lint naming guidelines here when naming your lint. In short, the name should state the thing that is being checked for and read well when used with allow/warn/deny. pedantic sets the lint level to Allow. The exact mapping can be found here The last part should be a text that explains what exactly is wrong with the code The rest of this file contains an empty implementation for our lint pass, which in this case is EarlyLintPass and should look like this: // clippy_lints/src/foo_functions.rs // .. imports and lint declaration .. declare_lint_pass!(FooFunctions => [FOO_FUNCTIONS]); impl EarlyLintPass for FooFunctions {} Normally after declaring the lint, we have to run cargo dev update_lints, which updates some files, so Clippy knows about the new lint. Since we used cargo dev new_lint ... to generate the lint declaration, this was done automatically. While update_lints automates most of the things, it doesn't automate everything. We will have to register our lint pass manually in the register_plugins function in clippy_lints/src/lib.rs: store.register_early_pass(|| box foo_functions::FooFunctions); As one may expect, there is a corresponding register_late_pass method available as well. Without a call to one of register_early_pass or register_late_pass, the lint pass in question will not be run. One reason that cargo dev does not automate this step is that multiple lints can use the same lint pass, so registering the lint pass may already be done when adding a new lint. Another reason that this step is not automated is that the order that the passes are registered determines the order the passes actually run, which in turn affects the order that any emitted lints are output in.

