With UI tests and the lint declaration in place, we can start working on the implementation of the lint logic. Let's start by implementing the EarlyLintPass for our FooFunctions: impl EarlyLintPass for FooFunctions { fn check_fn(&mut self, cx: &EarlyContext<'_>, fn_kind: FnKind<'_>, span: Span, _: NodeId) { // TODO: Emit lint here }
} We implement the check_fn method from the EarlyLintPass trait. This gives us access to various information about the function that is currently being checked. More on that in the next section. Let's worry about the details later and emit our lint for every function definition first. Depending on how complex we want our lint message to be, we can choose from a variety of lint emission functions. They can all be found in clippy_utils/src/diagnostics.rs . span_lint_and_help seems most appropriate in this case. It allows us to provide an extra help message and we can't really suggest a better name automatically. This is how it looks: impl EarlyLintPass for FooFunctions { fn check_fn(&mut self, cx: &EarlyContext<'_>, fn_kind: FnKind<'_>, span: Span, _: NodeId) { span_lint_and_help( cx, FOO_FUNCTIONS, span, "function named `foo`", None, "consider using a more meaningful name" ); }
} Running our UI test should now produce output that contains the lint message. According to the rustc-dev-guide , the text should be matter of fact and avoid capitalization and periods, unless multiple sentences are needed. When code or an identifier must appear in a message or label, it should be surrounded with single grave accents `.

