Writing the logic for your lint will most likely be different from our example, so this section is kept rather short. Using the check_fn method gives us access to FnKind that has the FnKind::Fn variant. It provides access to the name of the function/method via an Ident . With that we can expand our check_fn method to: impl EarlyLintPass for FooFunctions { fn check_fn(&mut self, cx: &EarlyContext<'_>, fn_kind: FnKind<'_>, span: Span, _: NodeId) { if is_foo_fn(fn_kind) { span_lint_and_help( cx, FOO_FUNCTIONS, span, "function named `foo`", None, "consider using a more meaningful name" ); } }
} We separate the lint conditional from the lint emissions because it makes the code a bit easier to read. In some cases this separation would also allow to write some unit tests (as opposed to only UI tests) for the separate function. In our example, is_foo_fn looks like: // use statements, impl EarlyLintPass, check_fn, .. fn is_foo_fn(fn_kind: FnKind<'_>) -> bool { match fn_kind { FnKind::Fn(_, ident, ..) => { // check if `fn` name is `foo` ident.name.as_str() == "foo" } // ignore closures FnKind::Closure(..) => false }
} Now we should also run the full test suite with cargo test. At this point running cargo test should produce the expected output. Remember to run cargo dev bless to update the .stderr file. cargo test (as opposed to cargo uitest) will also ensure that our lint implementation is not violating any Clippy lints itself. That should be it for the lint implementation. Running cargo test should now pass.

