} foo!("bar"); // if we lint the `match` of `foo` call and test its span
assert_eq!(in_macro(match_span), true); in_external_macro(): detect if the given span is from an external macro, defined in a foreign crate You may want to use it for example to not start linting in macros from other crates #[macro_use]
extern crate a_crate_with_macros; // `foo` is defined in `a_crate_with_macros`
foo!("bar"); // if we lint the `match` of `foo` call and test its span
