Projects that intend to support old versions of Rust can disable lints pertaining to newer features by specifying the minimum supported Rust version (MSRV) in the clippy configuration file. msrv = "1.30.0" The MSRV can also be specified as an inner attribute, like below. #![feature(custom_inner_attributes)]
#![clippy::msrv = "1.30.0"] fn main() { ...
} You can also omit the patch version when specifying the MSRV, so msrv = 1.30 is equivalent to msrv = 1.30.0. Note: custom_inner_attributes is an unstable feature so it has to be enabled explicitly. Lints that recognize this configuration option can be found here
